import React from 'react';
import {Form,Button} from "react-bootstrap";
import { useFormik } from 'formik';

const initialValues={
    details:'',
    phoneNo: '',
    otp: ''

}

const onSubmit= values=>{
    console.log('form data',values)
}

const BidDetails = () => {

    const formik = useFormik({
      initialValues,
      })


   
      console.log('Form Values', formik.values)
  return (
    <div className='main'>
      <Form>

      <Form.Group className="mb-3" controlId="exampleForm.ControlTextarea1">
    <Form.Label>Journey Details</Form.Label>
    <Form.Control as="textarea" rows={3} name="details"
    onChange={formik.handleChange}
    value={formik.values.details} />
  </Form.Group>
  <Form.Group className="mb-3" controlId="exampleForm.ControlInput1">
    <Form.Label>Enter your 10 digit Mobile Number</Form.Label>
    <Form.Control type="text" maxlength="10" 
    onChange={formik.handleChange}
    value={formik.values.phoneNo}/>
  </Form.Group>

  <Form.Group className="mb-3" controlId="exampleForm.ControlInput1">
    <Form.Label>Enter OTP</Form.Label>
    <Form.Control type="text" maxlength="4" 
    onChange={formik.handleChange}
    value={formik.values.otp}/>
  </Form.Group>
 
  <Button variant="primary" type="submit">
    Enter Bid Details
  </Button>
</Form>
</div>
  )
}

export default BidDetails
